import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import Cities from '.././Pages/Cities.js';
import CityProfile from '.././Pages/CityProfile.js';

class CityRouter extends Component {
  render() {
    const sf = {
      name: 'San Francisco, CA',
      age: '38.5',
      sunnyDays: '259',
      housePrice: '$1,119,000',
      crimeRate: '465.3',
      economicGrowth: '2.6%',
      eduLevel: 'B.S./Masters',
      politics: 'Very Liberal',
      diversity: 'Very Diverse',
      airQuality: '104',
    };
    return (
      <div>
        <Route exact path={this.props.match.path} component={Cities} />
        <Route
          path={`${this.props.match.path}/:cityname`}
          component={CityProfile}
        />
      </div>
    );
  }
}

export default CityRouter;
